import { StatusBar } from 'expo-status-bar';
import { useState } from 'react';
import { StyleSheet, Text, TextInput, Image, TouchableOpacity, SafeAreaView } from 'react-native';

export default function Home({ navigation }) {
        const [search, setSearch] = useState();

        const goToSearch = () => {
          navigation.navigate("Search", {
            text: search
          })
        }

  return (
    <SafeAreaView style={styles.container}>
      <Image style={styles.logo} source={require('../images/logo.png.jpg')} />
      <TextInput value={search} onChangeText={(e)=>setSearch(e)}/>
      <TouchableOpacity onPress={()=> goToSearch ()}>
        <Text>Procurar</Text>
      </TouchableOpacity>
      
      <StatusBar style="auto"/>  
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'white',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: 300,
    height: 300
  }
});
